namespace micromusic {
    export class Sample {
        private _audio: Buffer
        private _sampleName: string
        private _channel: number

        constructor(sample: string, channel: number) {
            this._audio = getSample(sample)
            this._sampleName = sample
            this._channel = channel
        }

        get audio() {
            return this._audio
        }

        get name() {
            return this._sampleName
        }

        get channel() {
            return this._channel
        }
    }

    const r8_drum = hex``

    const DblBass = hex``

    const FunBass_L = hex``

    const FunBass_S = hex``

    const PwmBass = hex``

    const ResBass = hex``

    const ShortB_H = hex``

    const ShortB_L = hex``

    const ShortB = hex``

    const sampleMap: { [key: string]: Buffer } = {
        r8_drum,
        DblBass,
        FunBass_L,
        FunBass_S,
        PwmBass,
        ResBass,
        ShortB_H,
        ShortB_L,
        ShortB,
    }

    export function getSample(name: string): Buffer | undefined {
        return sampleMap[name]
    }

    export function listSamples(): string[] {
        return Object.keys(sampleMap)
    }
}
